import React from 'react';
import { 
    Box, 
    Container, 
    Grid, 
    Card, 
    CardContent,
    Typography,
    IconButton,
    Tooltip,
    Paper
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import SchoolIcon from '@mui/icons-material/School';
import AssignmentIcon from '@mui/icons-material/Assignment';
import SmartToyIcon from '@mui/icons-material/SmartToy';

function Dashboard() {
    const cardData = [
        {
            title: 'Class Schedule',
            icon: <SchoolIcon />,
            description: 'Add your class schedule to get started',
            buttonTooltip: 'Add Class'
        },
        {
            title: 'Exam Dates',
            icon: <CalendarTodayIcon />,
            description: 'Add your upcoming exams',
            buttonTooltip: 'Add Exam'
        },
        {
            title: 'Tasks',
            icon: <AssignmentIcon />,
            description: 'Add tasks to optimize your study schedule',
            buttonTooltip: 'Add Task'
        },
        {
            title: 'AI Study Assistant',
            icon: <SmartToyIcon />,
            description: 'Get personalized study plans and assistance',
            buttonTooltip: 'Start Chat',
            specialButton: <SmartToyIcon />
        }
    ];

    return (
        <Box
            sx={{
                minHeight: 'calc(100vh - 64px)',
                background: 'linear-gradient(135deg, #111827 0%, #1F2937 100%)',
                py: 8,
                position: 'relative',
                '&::before': {
                    content: '""',
                    position: 'absolute',
                    top: 0,
                    right: 0,
                    bottom: 0,
                    left: 0,
                    background: 'radial-gradient(circle at 50% 0%, rgba(220, 20, 60, 0.15) 0%, transparent 70%)',
                    pointerEvents: 'none'
                }
            }}
        >
            <Container maxWidth="xl">
                <Grid container spacing={4}>
                    {cardData.map((card, index) => (
                        <Grid item xs={12} md={6} key={index}>
                            <Card
                                sx={{
                                    height: '100%',
                                    background: 'rgba(17, 25, 40, 0.75)',
                                    backdropFilter: 'blur(20px)',
                                    borderRadius: 4,
                                    border: '1px solid rgba(255, 255, 255, 0.1)',
                                    transition: 'all 0.3s ease-in-out',
                                    '&:hover': {
                                        transform: 'translateY(-4px)',
                                        boxShadow: '0 12px 28px rgba(220, 20, 60, 0.25)',
                                        '& .add-button': {
                                            opacity: 1,
                                            transform: 'scale(1)',
                                        }
                                    }
                                }}
                            >
                                <CardContent sx={{ height: '100%', p: 4 }}>
                                    <Box sx={{ 
                                        display: 'flex', 
                                        justifyContent: 'space-between', 
                                        alignItems: 'center', 
                                        mb: 4 
                                    }}>
                                        <Typography variant="h6" sx={{ 
                                            display: 'flex', 
                                            alignItems: 'center', 
                                            gap: 2,
                                            color: 'rgba(255, 255, 255, 0.95)',
                                            fontWeight: 600,
                                            '& .MuiSvgIcon-root': {
                                                color: '#DC143C',
                                                fontSize: '1.5rem'
                                            }
                                        }}>
                                            {card.icon}
                                            {card.title}
                                        </Typography>
                                        <Tooltip title={card.buttonTooltip}>
                                            <IconButton 
                                                className="add-button"
                                                sx={{ 
                                                    color: '#DC143C',
                                                    opacity: 0.7,
                                                    transform: 'scale(0.95)',
                                                    transition: 'all 0.3s ease-in-out',
                                                    '&:hover': {
                                                        background: 'rgba(220, 20, 60, 0.15)',
                                                        transform: 'scale(1.05)',
                                                    }
                                                }}
                                            >
                                                {card.specialButton || <AddIcon />}
                                            </IconButton>
                                        </Tooltip>
                                    </Box>
                                    <Paper
                                        sx={{
                                            p: 4,
                                            background: 'rgba(255, 255, 255, 0.02)',
                                            borderRadius: 3,
                                            textAlign: 'center',
                                            border: '1px dashed rgba(220, 20, 60, 0.3)',
                                            cursor: 'pointer',
                                            transition: 'all 0.3s ease-in-out',
                                            '&:hover': {
                                                background: 'rgba(255, 255, 255, 0.04)',
                                                border: '1px dashed rgba(220, 20, 60, 0.5)',
                                                transform: 'scale(1.01)',
                                            }
                                        }}
                                    >
                                        <Typography 
                                            color="text.secondary" 
                                            sx={{ 
                                                fontSize: '0.95rem',
                                                fontWeight: 500,
                                                letterSpacing: '0.015em'
                                            }}
                                        >
                                            {card.description}
                                        </Typography>
                                    </Paper>
                                </CardContent>
                            </Card>
                        </Grid>
                    ))}
                </Grid>
            </Container>
        </Box>
    );
}

export default Dashboard;
